def solucion_particular(Nu_L, Nu_A):
    Nu_AL = Nu_L | Nu_A
    yp_expr = ''
    for i, e in enumerate(Nu_AL - Nu_L):
        yp_expr += f'a{i+1}*{e}+'
    return yp_expr[:-1]

